import CircleImage from '../circleImage/CircleImage'
import Card from './Card'
import './Element.css'

const Element = (props) => {
  const logoContainer =  <CircleImage imagePath={props.logo} alt={'Logo'} width={80} height={80}/>;
  const descriptionCard = <Card />;
  const leftTimelineElement = <>
    {descriptionCard}
    {logoContainer}
  </>;
  const rightTimelineElement = <>
    {logoContainer}
    {descriptionCard}
  </>;

  return (
    <>
      {props.side === 'left' ? 
        <div className='timelineElement leftTimelineElement'>{leftTimelineElement}</div> 
        : 
        <div className='timelineElement rightTimelineElement'>{rightTimelineElement}</div>}
    </>
  )
}

export default Element;
